import logo from './logo.svg';
import './App.css';

let name="<b>Harry</b>";
function App() {
  return (
   <>
   <nav>
    <li>Home</li>
    <li>About</li>
    <li>Contact</li>
    <img src='' alt=""/>
    </nav>
    <div className='container'>
      <h1>hello {name}</h1>
      <p>Life is journey with lessons, hardships, heartache and special moments. 
        It's more of a journey than a destination, and it's of a journey than a destination,
         and it's important to live it peacefully and happily.</p>
    </div>
   </>
  );
}

export default App;
